import './feed.css';
import Share from '../share/Share';
import Post from '../post/Post';
import { useState } from 'react';

const Feed = () => {
  const [post, setPost] = useState([]);
  return (
    <div className="feed">
      <div className="feed-wrapper">
        {/* <Share />
        {Posts.map((post) => (
          <Post key={post.id} post={post} />
        ))} */}
      </div>
    </div>
  );
};

export default Feed;
